            for (let i = 0; i < 3; i += 1) {
                context.dictionary.set(i, i);
            }

            while (context.power != context.maxPower) {
                context.resb = context.dataVal & context.dataPosition;
                context.dataPosition >>= 1;
                if (context.dataPosition == 0) {
